export function CompaniesData() {
    return [{
		"id": 0,
		"company_name": "Entreprise Services CDG"
	},{
		"id": 1,
		"company_name": "Docuprint"
	},{
		"id": 4,
		"company_name": "Forsa Net"
	},{
		"id": 5,
		"company_name": "Emma Productions"
	},{
		"id": 11,
		"company_name": "Spss Maghreb",
		"nature": "Siège",
		"creation_year": 2001,
		"juridic_form": "S.a.r.l.",
		"activities": "Conseil informatique (6202)",
		"url": "https://ma.kompass.com/c/spss-maghreb/ma3114024/",
		"latitude": 34.0208892822266,
		"longitude": -6.84163999557495,
		"company_id": "MA3114024",
		"address": "cité Ibn Sina, Agdal",
		"cp": 10090,
		"ville": "Rabat"
	}
]
}

export function renderCompanyName(state, val) {
    return (
        state.company_name.toString().toLowerCase().indexOf(val.toLowerCase()) !== -1
    );
}
